content:
in un paese giusto la canzone di fedez verrebbe valorizzata esattamente quella di cristicchi; 
ma in italia dove vengono ignorate le “persone interrotte” chiamandole con l’appellativo di “pazzi”, ed i suicidi passano in secondo piano, non mi meraviglio che sia così. 
#Sanremo2025

Ma solo io penso che 
@Fedez
 abbia un brano coraggioso, per nulla banale e ben interpretato? Non mi stupirei se arrivasse in alto in classifica, meriterebbe #Sanremo2025 #sanremo25 #Sanremo
